import BlogList from "./BlogList";
import Header from "./Header";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Header />
        <Switch>
          <Route exact path="/" component={BlogList} />
          <Route path="/blog" component={Blog} />
          {/* Other routes */}
        </Switch>
      </div>
    </BrowserRouter>
  );
}

export default App;
